const router = createBrowserRouter([
  {
    path: "/",
    element: <Layout />,
    children: [
      // ... 其他路由
      {
        path: "*",
        element: <NotFound />,
      },
    ],
  },
]);

// NotFound 组件
function NotFound() {
  const location = useLocation();

  return (
    <div className="text-center py-12">
      <h1 className="text-4xl font-bold text-gray-900 mb-4">404</h1>
      <p className="text-gray-600 mb-4">
        页面 "{location.pathname}" 不存在
      </p>
      <Link
        to="/"
        className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
      >
        返回首页
      </Link>
    </div>
  );
}`,tips:['使用通配符路由 "*" 捕获所有未匹配的路径',"在 NotFound 组件中显示当前访问的路径","提供返回首页或其他有用页面的链接","考虑添加搜索功能帮助用户找到内容"]},redirect:{title:"路由重定向",problem:"需要将用户从一个路由重定向到另一个路由",solution:`// 使用 Navigate 组件进行重定向
import { Navigate } from 'react-router-dom';

const router = createBrowserRouter([
  {
    path: "/",
    element: <Layout />,
    children: [
      {
        path: "old-page",
        element: <Navigate to="/new-page" replace />,
      },
      {
        path: "new-page",
        element: <NewPage />,
      },
      // 条件重定向
      {
        path: "dashboard",
        element: <ConditionalRedirect />,
      },
    ],
  },
]);

// 条件重定向组件
function ConditionalRedirect() {
  const { user } = useAuth();

  if (!user) {
    return <Navigate to="/login" replace />;
  }

  if (user.role === 'admin') {
    return <Navigate to="/admin" replace />;
  }

  return <Dashboard />;
}`,tips:["使用 Navigate 组件进行声明式重定向","replace 属性避免在历史记录中留下重定向记录","可以基于条件进行动态重定向","在 loader 中也可以抛出 redirect 响应"]},loading:{title:"加载状态处理",problem:"在数据加载过程中显示加载指示器",solution:`// 使用 useNavigation 获取导航状态
import { useNavigation } from 'react-router-dom';

function Layout() {
  const navigation = useNavigation();
  const isLoading = navigation.state === 'loading';

  return (
    <div>
      <nav>
        {/* 导航菜单 */}
      </nav>

      {isLoading && (
        <div className="fixed top-0 left-0 w-full h-1 bg-blue-500 animate-pulse" />
      )}

      <main className={isLoading ? 'opacity-50' : ''}>
        <Outlet />
      </main>
    </div>
  );
}

